import React, { useCallback, useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { showRenewHistory } from '../redux/actions/actions'

const History = () => {
  const { history } = useSelector((value) => value.numReducer)
  const dispatch = useDispatch()

  useEffect(() => {
    dispatch(showRenewHistory())
  }, [])

  return (
    <div>
      {!history ? <div>История пуста</div> : history}
    </div>
  )
}

export default History
